import React from "react";

function CartProduct({ item }) {
  return (
    <div className="singleProduct one" onClick={() => openProduct(item.id)}>
      <img src={item.image} alt="" />
      <div>{item.title}</div>
      <div>Price:{item.price}</div>
    </div>
  );
}

export default CartProduct;
